let players = [
    { id: 1, name: 'Lebron James', team: 'Lakers' },
    { id: 2, name: 'Luka Doncic', team: 'Mavericks' },
    { id: 3, name: 'Michael Jordan', team: 'Bulls' },
    { id: 4, name: 'Jayson Tatum', team: 'Celtics' }
  ];

module.exports = players;
